column.value:
context.username = input_row.username.toUpperCase();
context.password = input_row.password;
context.username_condition = "{\"$eq\":{\"username\":\"" + context.username + "\"}}";

if (input_row.string.contains("DocumentStream")) {
	JSONObject ds = new JSONObject(input_row.string);
	JSONArray dsa = ds.getJSONArray("DocumentStream");
	for (int i = 0; i < dsa.length(); i++) {
		JSONObject u = dsa.getJSONObject(i);
		String p = u.getString("password");
		String t = u.getString("type");
		if (p.equals(context.password)) {
			output_row.result = "true";
			output_row.type = t;
		} else {
			output_row.result = "false";
			output_row.type = "nothing";
		}
	}
} else {
	output_row.result = "false";
	output_row.type = "nothing";
}
